.container {
  outline: none;
  white-space: nowrap;
  display: table;
  table-layout: auto;

}
.container > * {
  height: 100% !important;
  display: table-cell !important;
  vertical-align: middle !important;
}
.border {
  border-style: solid;
  border-width: 1px;
}
/* 标题文本 */
.label {
  padding: 0 10px 0 6px;
  white-space: nowrap;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
  text-align: justify;
  text-align-last: justify;
}
.label_text{
  position: relative;

}
/* 必填 */
.required {
  position: absolute;
  top: -10px;
  right: -3px;
  /* padding: 0 5px 0 2px; */
  font-size: 18px;
  font-weight: 700;
  color: #f00;
  user-select: none;
  -webkit-user-select: none;
  -ms-user-select: none;
  -moz-user-select: none;
}
